import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'bootstrap';
import './css/Elite.css';
import imagen16 from '../../Assets/imagen16-editada.JPG';

function Elite(){
    return(
        
            
                <div class="row">
                    <div class="col-4 custom-bg d-flex align-items-center justify-content-center">
                        <img src={imagen16} alt="Presentación" class="img-fluid custom-image"/>
                    </div>
                    <div class="col-8 elite-info align-items-center justify-conent-center">
                    <p class="custom-highlight">Innoventa Élite</p>
                        
                    </div>
                </div>
        
      
    )
}

export default Elite;
